  },
  password: {
    fieldType: 'input',
    hidden: true,
    name: 'Password',
    placeholder: 'Eg, ........',
  },
  error: null,
  success: null,
  loading: false,
};

export const registerForm = {
  firstName: '',
  middleName: '',
  lastName: '',
  email: '',
  password: '',
  confirmPassword: '',
  error: null,
  success: null,
  loading: false,
};
